import React from "react";
import { useUser } from "./context/UserContext";

const Login = () => {
  const { Login } = useUser();
  const handleLogin = () => {
    Login("Valeri Kuzmini");
  };
  return (
    <>
      <button onClick={handleLogin}>Log In as Valeri</button>
    </>
  );
};

export default Login;
